import React from 'react';

export default function Nav2({ items }) {
  return (
    <div className="table-of-contents">
      { items.map(item => {
        return (
          // <div style={{color: 'red'}}>{ item }</div>
          <div className="toc-item">
            <p class="toc-name hidden">{ item }</p>
          </div>
        )
      }) }
    </div>
  )
};
